import React from "react";
import { LineChart, Line, CartesianGrid, XAxis, YAxis } from 'recharts';

const data = [{name: '1', uv: 10, pv: 2400, amt: 2400}, 
              {name: '2', uv: 20, pv: 2400, amt: 2400},
              {name: '3', uv: 30, pv: 2300, amt: 2400}, 
              {name: '4', uv: 60, pv: 2200, amt: 2400},
              {name: '5', uv: 100, pv: 2400, amt: 2400}, 
              {name: '6', uv: 200, pv: 2400, amt: 2400},
              {name: '7', uv: 250, pv: 2300, amt: 2400}, 
              {name: '8', uv: 340, pv: 2200, amt: 2400},
              {name: '9', uv: 700, pv: 2400, amt: 2400},
              {name: '10', uv: 1000, pv: 2300, amt: 2400}];



const Chart = () => {
  return (
    <>
        <LineChart width={600} height={300} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
          <Line type="monotone" dataKey="uv" stroke="#8884d8" />
          <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
          <XAxis dataKey="name" />
          <YAxis />
        </LineChart>
    </>
  );
};



export default Chart;
